import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To reveal the view mode buttons, we first need to navigate to a product list.
    // We will click on a category card to do this.
    const electronicsCategory = page.locator('.category-card', { hasText: 'Electronics' });
    await electronicsCategory.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsCategory.click();

    // Wait for the view toggle buttons to appear after navigation
    const listViewButton = page.locator('button[title="List View"]');
    await listViewButton.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_grid_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_grid_view.png'));

    // Click the "List View" button
    await listViewButton.click();

    // Wait for the product container to switch to list view mode
    await page.waitForSelector('.products-list', { state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Extract data to verify the switch
    const listItemsCount = await page.locator('.product-card-list').count();
    const isListViewActive = await page.locator('button[title="List View"]').getAttribute('class');

    return {
      success: true,
      action: "Switched to List View Mode",
      extractedData: {
        listItemsCount: listItemsCount,
        isListViewButtonActive: isListViewActive.includes('active')
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
